DROP TABLE IF EXISTS `mbs_user`;
CREATE TABLE `mbs_user` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL COMMENT '名称',
  `password` varchar(255) NOT NULL COMMENT '密码',
  `birth` varchar(255) DEFAULT NULL COMMENT '生日',
  `sex` tinyint(2) DEFAULT NULL COMMENT '性别',
  `phone` varchar(255) NOT NULL COMMENT '电话',
  `email` varchar(255) DEFAULT NULL COMMENT '邮箱',
  `address` varchar(255) DEFAULT NULL COMMENT '地址',
  `chain_id` int(11) NOT NULL COMMENT '门店id',
  `chain_name` varchar(255) NOT NULL COMMENT '门店名称',
  `job_name` varchar(255) NOT NULL COMMENT '职位',
  `grade_id` int(11) NOT NULL COMMENT '职级id',
  `grade_name` varchar(255) NOT NULL COMMENT '职级名称',
  `en_name` varchar(255) DEFAULT NULL COMMENT '英文名',
  `nickname` varchar(255) DEFAULT NULL COMMENT '昵称',
  `quanpin` varchar(255) NOT NULL COMMENT '名称全拼',
  `jianxie` varchar(255) NOT NULL COMMENT '名称简写',
  `nick_quan_pin` varchar(255) DEFAULT NULL COMMENT '昵称全拼',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '状态',
  `role` varchar(255) DEFAULT NULL COMMENT '权限',
  `user_group` int(11) NOT NULL,
  `usrsrc` mediumblob,
  PRIMARY KEY (`id`),
  UNIQUE KEY `phone` (`phone`)
) ENGINE=MyISAM AUTO_INCREMENT=35 DEFAULT CHARSET=utf8 COMMENT='管理员/员工表';

